import Drop from "./Drop.module.css";
function Company(){
    var link = "#";
    return (
        <div className={Drop.DropDown}>
                        <span><a href={link}>History</a></span>
                        <span><a href={link}>Our Team</a></span>
                        <span><a href={link}>Blog</a></span>
                    </div>
    );
}

export default Company;
